import React,{useContext,useEffect} from 'react'
import flightContent from "../context/FlightContext";
import '../styles/Bookings.css'



const MyBookings = () => {
    const content = useContext(flightContent)
    const {bookings, getBookingsWU} = content 

    useEffect(() => {
        getBookingsWU()
    }, [])

  return (
    <div>
        <div className='bookings-con'>
            <div className='bk-con-title'>MyBookings</div>
            <div className='bk-con-body'>
                {bookings.map((element)=>{
                    return  <div className='bk-con-b-item'>
                                <div>{element.departure}</div>
                                <div>-</div>
                                <div>{element.destination}</div>
                            </div>
                })}
            </div>
        </div>
    </div>
  )
}

export default MyBookings
